import React ,{useState,useEffect}from 'react';
import {Text,View,StyleSheet,
    ImageBackground,Image,
    TouchableOpacity,
    ScrollView,
    ActivityIndicator,
    Alert,
    Modal,
    TouchableHighlight,
    TextInput,
    
} from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import { Button } from 'react-native-paper';
import Edit from '../assets/edit.tsx'

import Feather from 'react-native-vector-icons/Feather';
import Ionicons from "react-native-vector-icons/Ionicons";
import * as  donotallow from "../store/action/auth";
import * as profileee from   '../store/action/profile';
 import * as profileupdatee from '../store/action/profileupdate';

import DateTimePicker from '@react-native-community/datetimepicker';

import {useDispatch,useSelector} from 'react-redux';
const Profile=({navigation})=>{
    const dispatch=useDispatch();
     const [isloadingmm,setisloadingmm]=useState(false);
     const [isloadingm,setisloadingm]=useState(false)
     const [error,seterror]=useState();
     const [isloading,setisloading]=useState(false);
     const [isloadingg,setisloadingg]=useState(false);
     
     const student_id=useSelector(state=>state.StudentId.studentid)
     const profileobj=useSelector(state=>state.Profileofst.profiledetails)
    
     console.log("this is the profile detaills "+ profileobj.st_id)
     const [modalVisible, setModalVisible] = useState(false);
     const [enteredusername,setenteredusername]=useState(profileobj.st_name)
     const [enteredemail,setenteredemail]=useState()
     const [enteredfathername,setenteredfathername]=useState()
     const [enteredmothername,setenteredmothername]=useState()
     const [date, setDate] = useState(new Date())
     const [show,setshow]=useState(false)
    
     const [enteredgender,setenteredgender]=useState();
     const [enteredaddress,setenteredaddress]=useState()
     console.log(date   +  enteredusername +enteredaddress +enteredemail +enteredgender +enteredfathername +enteredmothername)
    const doonotallow=async()=>{
        // seterror(null)
   
        setisloadingmm(true)
        try{
       await   dispatch(donotallow.donotallowuser(null))
        }catch(error){
        //  seterror(error.message)
          setisloadingmm(false)
        }
      }

      const Profiledetail=async()=>{
        
  
        seterror(null)
         setisloading(true)
         try{
            
          
          await dispatch(profileee.profileofstudent(student_id))
          
         }catch(error){
          
             seterror(error.message)
            setisloading(false) 
      
       }
        
      
      };
      const Profileupdate=async()=>{
        
  
        seterror(null)
        setisloadingg(true)
         try{
            
          
          await dispatch(profileupdatee.profileupdateofstudent(
              profileobj.st_id,
              enteredusername,
              enteredemail,
              enteredfathername,
              enteredmothername,
              '15-07-1999',
              enteredgender,
              enteredaddress
            ))
          console.log("profile is updated")
          setModalVisible(!modalVisible)
          Profiledetail();
          setisloadingg(false) 
         }catch(error){
          
          seterror(error.message)
         
      
       }
        
      
      };
           
      useEffect(() => {
          
          if (error) {
            Alert.alert('An Error Occurred!', error, [{ text: 'Okay' }]);
          }
          Profiledetail()
        }, [error]);

        const retrievenamehandler=(enteredText)=>{
            setenteredusername(enteredText)
        }
        const retrieveemailhandler=(enteredText)=>{
            setenteredemail(enteredText)
        }
        const retrievefathernamehandller=(enteredText)=>{
            setenteredfathername(enteredText)
        }
        const retrievemothernamehandller=(enteredText)=>{
            setenteredmothername(enteredText)
        }
        const selecteddate=(enteredText)=>{
            setDate(enteredText)
        }
        const retrievegenderhandler=(enteredText)=>{
            setenteredgender(enteredText)
        }
        const retrieveaddresshandler=(enteredText)=>{
            setenteredaddress(enteredText)
        }
      const usernamelogged=useSelector(state=>state.Auth.usernamee)
      console.log(usernamelogged +"not llgettl")
    return(
        <ScrollView>
        <View style={styles.main}>
        
          {/* <View style={styles.pimage}>
          <Image style={{width:84,height:84,
                borderRadius:40,
             }} source={{uri:"https://s3-us-west-2.amazonaws.com/asset.plexuss.com/news/images/successful-college-student-lg.png"}}
             
        />
          
          </View> */}
            <View style={styles.user}>
              <LinearGradient
           // Background Linear Gradient
               colors={['#007E59', '#007E59']}
               start={[.9,.0]}
                style={{
                   position: 'absolute',
                  left: 0,
                     right: 0,
                    top: 0,
                  height: 80,
                  
                  }}
                 />
                    <TouchableOpacity>
                   <View style={styles.logo}>
                   <Ionicons name="ios-arrow-back" size={24} color="white" onPress={()=>navigation.goBack()}/>
                    </View> 
                 </TouchableOpacity>
                  
                   <View style={styles.username}>
                            <Text style={styles.usernamechild}>Profile</Text>
                   </View>
                   <View style={styles.logout}>
                       {isloadingmm?<ActivityIndicator/>:
                         <Text 
                         style={styles.logoutchild}
                         onPress={doonotallow}

                         >Logout</Text>}
                   </View>
                
                   </View>


                   <Modal
                       animationType="fade"
                       transparent={false}
                        visible={modalVisible}
                        onRequestClose={() => {
                            setModalVisible(!modalVisible)
                         }}
                   >
                
                
        <View style={styles.centeredview}>    
        <ScrollView   showsVerticalScrollIndicator={false}>   
            <View style={styless.main}>
      
                <View style={styless.dabba}>
            
              <Text style={styless.urnam}>studentname</Text>
              <View style={styless.Vieweye}>
             
                    <TextInput 
                  style={styless.textinputstyle}
                   placeholder={profileobj.st_name}
                    keyboardtype="default"
                    
                    onChangeText={retrievenamehandler}
                    value={enteredusername}
                    />
                  
               </View>
               <Text style={styless.urnam}>Email</Text>
              <View style={styless.Vieweye}>
             
                    <TextInput 
                  style={styless.textinputstyle}
                   placeholder="mobilenumber"
                    keyboardtype='default'
                    
                    onChangeText={retrieveemailhandler}
                     value={enteredemail}
                    />
                  
               </View>
               <Text style={styless.urnam}>
                   FatherName
               </Text>
              <View style={styless.Vieweye}>
             
                    <TextInput 
                  style={styless.textinputstyle}
                   placeholder="fathersname"
                    keyboardtype="default"
                    
                     onChangeText={retrievefathernamehandller}
                    value={enteredfathername}
                    />
                  
               </View>
               <Text style={styless.urnam}>
                   MotherName
               </Text>
              <View style={styless.Vieweye}>
             
                    <TextInput 
                  style={styless.textinputstyle}
                   placeholder="mothername"
                    keyboardtype="default"
                    
                     onChangeText={retrievemothernamehandller}
                     value={enteredmothername}
                    />
                  
               </View>
               <Text style={styless.urnam}>
                   DOB
               </Text>
              <View style={styless.Vieweye}>
             
          {show?        
                  <DateTimePicker
                        testID="dateTimePicker"
                        value={date}
                        mode="date"
                       // is24Hour={true}
                       display="default"
                      onChange={selecteddate}
                  />:
                  <Button mode="outlined" onPress={() => setshow(!show)}>
                       Select Dob
                 </Button>
          }     
               </View>
               <Text style={styless.urnam}>
                   Gender
               </Text>
              <View style={styless.Vieweye}>
             
                    <TextInput 
                  style={styless.textinputstyle}
                   placeholder="male/female"
                    keyboardtype="default"
                    
                    onChangeText={retrievegenderhandler}
                     value={enteredgender}
                    />
                  
               </View>
               <Text style={styless.urnam}>
                   Address
               </Text>
              <View style={styless.Vieweye}>
             
                    <TextInput 
                  style={styless.textinputstyle}
                   placeholder="address"
                    keyboardtype="default"
                    
                     onChangeText={retrieveaddresshandler}
                     value={enteredaddress}
                    />
                  
               </View>
              
             <TouchableOpacity
                  onPress={ 
                    Profileupdate
                    // setModalVisible(!modalVisible);
                   
              }
              style={{marginLeft:"17%"}}
             >
             <LinearGradient
          // Button Linear Gradient
         
          colors={['#C53030', '#C53030']}
          start={[.9,.0]}
          style={{ padding: 15,
           alignItems: 'center',
            borderRadius: 5,
            width:200,
        
            
            marginTop:25 }}>
              {isloadingg?<ActivityIndicator/>:
          <Text
            style={{
              backgroundColor: 'transparent',
              fontSize: 16,
              color: '#fff',
              fontFamily:"Poppins-Bold"
            }}>
          Submit
          </Text>}
        </LinearGradient>
    </TouchableOpacity>
         </View>

        </View>
</ScrollView>
                       
                    </View>
                
                     </Modal>



           <View style={styles.firstdaba}>
               <View style={styles.veryfirstchilddabba}>
               <View style={{flexDirection:"row",
                 alignItems:"center",
                 width:"80%",
                
                 justifyContent:"space-around"
               }}>   
               <View style={styles.pimage}>
                <Image style={{width:84,height:84,
                borderWidth:3.5,
                borderColor:"#007E59",
                borderRadius:40}} source={require('../assets/drawable-hdpi/student.png')}/>
               </View>
               <View style={styles.idd}>

                   
                   <Text style={{
                       color:"#888888",
                       fontFamily:"Rubik-Regular",
                       fontSize:11
                   }}>ID NO.</Text>
                   <Text style={{
                       color:"#2F4858",
                       fontFamily:"Rubik-Bold",
                       fontSize:12
                   }}>{profileobj.st_id}</Text>
               </View>
               </View>
               </View>
               <View>
                <Text style={styles.username}>{profileobj.st_name}</Text>
               </View>
                   <View>
                <Text style={styles.father}>{profileobj.st_father_name}</Text>
                   </View>
                   <View>
                <Text style={styles.mobile}>Mob. : +91{profileobj.st_mobile_no}</Text>
                   </View>
                   <View style={styles.addd}>
                           <Text style={styles.address}>Address:</Text>
                           <Text style={styles.address} numberOfLines={4}>
                               F-44 Room No - 10 Second Floor Katwaria Sarai Near Shiv Mandir Hauz Khas New Delhi - 110016
                           </Text>
                   </View>
                 
           </View>
            <View style={styles.edit}>
                <View style={{height:8}}><Feather name="edit" size={18} color="#888888" /></View> 
                <TouchableOpacity
                   onPress={()=>setModalVisible(true)}
                >
                <Text style={{
                    color:"#888888",
                    fontFamily:"Rubik-Regular",
                    fontSize:12,
                marginLeft:5
                }}
               
                >Edit Profile</Text>
                </TouchableOpacity>
            </View>
            <TouchableOpacity >
            <View style={styles.seconddabba}>
            <LinearGradient
           // Background Linear Gradient
               colors={['#2F4858', '#007E59']}
               start={[.9,.0]}
                style={{
                   position: 'absolute',
                  left: 0,
                     right: 0,
                    top: 0,
                  height: 250,
                  borderRadius:5
                  
                  }}
                 />
               
               <View style={styles.rightdabba}>
                   <View>
                       <Text style={styles.subs}>Subscription Plan</Text>
                   </View>
                   <View>
                       <Text style={styles.stta}>CLASS-2</Text>
                   </View>
                   <View>
                       <Text style={styles.subs}>Subject</Text>
                   </View>
                   <View>
                       <Text style={styles.subss}>MATH | ENGLISH | ART | HINDI </Text>
                   </View>
                   <View>
                       <Text style={styles.subss}>SOCIAL SCIENCE | SCIENCE </Text>
                   </View>
                   <View>
                       <Text style={styles.subs}>Amount </Text>
                   </View>
                   <View>
                       <Text style={styles.subsamt}>950 </Text>
                   </View>
                   <View>
                       <Text style={styles.subs}>Expire : 20 AUG 2020</Text>
                   </View>
                   <View style={styles.upp}>
                   <Button  mode="outlined"
                    loading={false}
                  labelStyle={{color:"white" ,fontFamily:"Rubik-Regular",fontSize:15}}
                  contentStyle={{backgroundColor:"#C53030"}}
                     style={{width:"80%"}}
                     onPress={()=>navigation.navigate('Subplan')}>
                   RENEW
                  </Button>
                   </View>
               </View>

               <View style={{marginTop:100}}>
                 <Image style={{width:120,height:97,}} source={require('../assets/drawable-hdpi/book.png')}/>
               </View>
            </View>
          </TouchableOpacity>
    


        </View>
        </ScrollView>
    )
}
